import React from "react";
import "../styles/styles.css";

const SearchBar = ({ searchFunction }) => {
  return (
    <div>
      <input type="text" id="search-term" />
      <button type="button" id="search-button" onClick={searchFunction}>
        Search
      </button>
    </div>
  );
};
export default SearchBar;
